<?php

declare(strict_types=1);

namespace Swoole\Connection;

/**
*<div id="class.iterator" class="reference"> <h1 class="title">Iterator（迭代器）接口</h1>  <div class="partintro"><p class="verinfo">(PHP 5, PHP 7, PHP 8)</p>  <div class="section" id="iterator.intro">   <h2 class="title">简介</h2>   <p class="para">    可在内部迭代自己的外部迭代器或类的接口。   </p>  </div>  <div class="section" id="iterator.synopsis">   <h2 class="title">接口摘要</h2>   <div class="classsynopsis"><div class="classsynopsisinfo">    <span class="modifier">interface</span> <strong class="interfacename"><strong class="interfacename">Iterator</strong></strong>    <span class="modifier">extends</span>      <a href="https://www.php.net/manual/zh/class.traversable.php" class="interfacename">Traversable</a> {</div>        <div class="classsynopsisinfo classsynopsisinfo_comment">// 方法 </div>    <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="methodname" style="color:#CC7832"><a href="https://www.php.net/manual/zh/iterator.current.php" class="methodname" style="color:#CC7832">current</a></span>(): <span class="type" style="color:#EAB766"><a href="https://www.php.net/manual/zh/language.types.declarations.php#language.types.declarations.mixed" class="type mixed" style="color:#EAB766">mixed</a></span></div><div class="methodsynopsis dc-description"><span class="modifier">public</span> <span class="methodname" style="color:#CC7832"><a href="https://www.php.net/manual/zh/iterator.key.php" class="methodname" style="color:#CC7832">key</a></span>(): <span class="type" style="color:#EAB766"><a href="https://www.php.net/manual/zh/language.types.declarations.php#language.types.declarations.mixed" class="type mixed" style="color:#EAB766">mixed</a></span></div><div class="methodsynopsis dc-description"><span class="modifier">public</span> <span class="methodname" style="color:#CC7832"><a href="https://www.php.net/manual/zh/iterator.next.php" class="methodname" style="color:#CC7832">next</a></span>(): <span class="type" style="color:#EAB766"><span class="type void" style="color:#EAB766">void</span></span></div><div class="methodsynopsis dc-description"><span class="modifier">public</span> <span class="methodname" style="color:#CC7832"><a href="https://www.php.net/manual/zh/iterator.rewind.php" class="methodname" style="color:#CC7832">rewind</a></span>(): <span class="type" style="color:#EAB766"><span class="type void" style="color:#EAB766">void</span></span></div><div class="methodsynopsis dc-description"><span class="modifier">public</span> <span class="methodname" style="color:#CC7832"><a href="https://www.php.net/manual/zh/iterator.valid.php" class="methodname" style="color:#CC7832">valid</a></span>(): <span class="type" style="color:#EAB766">bool</span></div>   }</div>  </div>    <div class="section" id="iterator.iterators">   <h2 class="title">预定义迭代器</h2>   <p class="para">    PHP 已经提供了一些用于日常任务的迭代器。    详细列表参见 <a href="https://www.php.net/manual/zh/spl.iterators.php" class="link">SPL 迭代器</a>。   </p>  </div>    <div class="section" id="iterator.examples">  <h2 class="title">示例</h2>   <div class="example" id="example-1163">    <p><strong>示例 #1 基本用法</strong></p>    <div class="example-contents"><p>     这个例子展示了使用 <a href="https://www.php.net/manual/zh/control-structures.foreach.php" class="link">foreach</a> 时，迭代器方法的调用顺序。    </p></div>    <div class="example-contents"><div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br /></span><span style="color: #007700">class </span><span style="color: #9876AA">myIterator </span><span style="color: #007700">implements </span><span style="color: #9876AA">Iterator </span><span style="color: #007700">{<br />    private </span><span style="color: #9876AA">$position </span><span style="color: #007700">= </span><span style="color: #9876AA">0</span><span style="color: #007700">;<br />    private </span><span style="color: #9876AA">$array </span><span style="color: #007700">= array(<br />        </span><span style="color: #DD0000">"firstelement"</span><span style="color: #007700">,<br />        </span><span style="color: #DD0000">"secondelement"</span><span style="color: #007700">,<br />        </span><span style="color: #DD0000">"lastelement"</span><span style="color: #007700">,<br />    );  <br /><br />    public function </span><span style="color: #9876AA">__construct</span><span style="color: #007700">() {<br />        </span><span style="color: #9876AA">$this</span><span style="color: #007700">-&gt;</span><span style="color: #9876AA">position </span><span style="color: #007700">= </span><span style="color: #9876AA">0</span><span style="color: #007700">;<br />    }<br /><br />    public function </span><span style="color: #9876AA">rewind</span><span style="color: #007700">(): </span><span style="color: #9876AA">void </span><span style="color: #007700">{<br />        </span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">__METHOD__</span><span style="color: #007700">);<br />        </span><span style="color: #9876AA">$this</span><span style="color: #007700">-&gt;</span><span style="color: #9876AA">position </span><span style="color: #007700">= </span><span style="color: #9876AA">0</span><span style="color: #007700">;<br />    }<br /><br />    #[</span><span style="color: #9876AA">\ReturnTypeWillChange</span><span style="color: #007700">]<br />    public function </span><span style="color: #9876AA">current</span><span style="color: #007700">() {<br />        </span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">__METHOD__</span><span style="color: #007700">);<br />        return </span><span style="color: #9876AA">$this</span><span style="color: #007700">-&gt;</span><span style="color: #9876AA">array</span><span style="color: #007700">[</span><span style="color: #9876AA">$this</span><span style="color: #007700">-&gt;</span><span style="color: #9876AA">position</span><span style="color: #007700">];<br />    }<br /><br />    #[</span><span style="color: #9876AA">\ReturnTypeWillChange</span><span style="color: #007700">]<br />    public function </span><span style="color: #9876AA">key</span><span style="color: #007700">() {<br />        </span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">__METHOD__</span><span style="color: #007700">);<br />        return </span><span style="color: #9876AA">$this</span><span style="color: #007700">-&gt;</span><span style="color: #9876AA">position</span><span style="color: #007700">;<br />    }<br /><br />    public function </span><span style="color: #9876AA">next</span><span style="color: #007700">(): </span><span style="color: #9876AA">void </span><span style="color: #007700">{<br />        </span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">__METHOD__</span><span style="color: #007700">);<br />        ++</span><span style="color: #9876AA">$this</span><span style="color: #007700">-&gt;</span><span style="color: #9876AA">position</span><span style="color: #007700">;<br />    }<br /><br />    public function </span><span style="color: #9876AA">valid</span><span style="color: #007700">(): </span><span style="color: #9876AA">bool </span><span style="color: #007700">{<br />        </span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">__METHOD__</span><span style="color: #007700">);<br />        return isset(</span><span style="color: #9876AA">$this</span><span style="color: #007700">-&gt;</span><span style="color: #9876AA">array</span><span style="color: #007700">[</span><span style="color: #9876AA">$this</span><span style="color: #007700">-&gt;</span><span style="color: #9876AA">position</span><span style="color: #007700">]);<br />    }<br />}<br /><br /></span><span style="color: #9876AA">$it </span><span style="color: #007700">= new </span><span style="color: #9876AA">myIterator</span><span style="color: #007700">;<br /><br />foreach(</span><span style="color: #9876AA">$it </span><span style="color: #007700">as </span><span style="color: #9876AA">$key </span><span style="color: #007700">=&gt; </span><span style="color: #9876AA">$value</span><span style="color: #007700">) {<br />    </span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">$key</span><span style="color: #007700">, </span><span style="color: #9876AA">$value</span><span style="color: #007700">);<br />    echo </span><span style="color: #DD0000">"\n"</span><span style="color: #007700">;<br />}<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>    </div>    <div class="example-contents"><p>以上示例的输出类似于：</p></div>    <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;"><div class="cdata"><span>string(18) &quot;myIterator::rewind&quot;<br>string(17) &quot;myIterator::valid&quot;<br>string(19) &quot;myIterator::current&quot;<br>string(15) &quot;myIterator::key&quot;<br>int(0)<br>string(12) &quot;firstelement&quot;<br><br>string(16) &quot;myIterator::next&quot;<br>string(17) &quot;myIterator::valid&quot;<br>string(19) &quot;myIterator::current&quot;<br>string(15) &quot;myIterator::key&quot;<br>int(1)<br>string(13) &quot;secondelement&quot;<br><br>string(16) &quot;myIterator::next&quot;<br>string(17) &quot;myIterator::valid&quot;<br>string(19) &quot;myIterator::current&quot;<br>string(15) &quot;myIterator::key&quot;<br>int(2)<br>string(11) &quot;lastelement&quot;<br><br>string(16) &quot;myIterator::next&quot;<br>string(17) &quot;myIterator::valid&quot;<br></span></div>    </div>   </div>  </div>  <div class="section" id="iterator.seealso">  <h2 class="title">参见</h2>   <p class="para">参见 <a href="https://www.php.net/manual/zh/language.oop5.iterations.php" class="link">遍历对象</a>。</p>  </div> </div>     <h2>目录</h2><ul class="chunklist chunklist_reference"><li>{@link Iterator::current} — 返回当前元素</li><li>{@link Iterator::key} — 返回当前元素的键</li><li>{@link Iterator::next} — 向前移动到下一个元素</li><li>{@link Iterator::rewind} — 返回到迭代器的第一个元素</li><li>{@link Iterator::valid} — 检查当前位置是否有效</li></ul></div>
*/
class Iterator implements \Iterator, \ArrayAccess, \Countable
{
    public function __construct() {}

    public function __destruct() {}

/**
*<div id="iterator.rewind" class="refentry"> <div class="refnamediv">  <h1 class="refname">Iterator::rewind</h1>  <p class="verinfo">(PHP 5, PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">Iterator::rewind</span> &mdash; <span class="dc-title">返回到迭代器的第一个元素</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-iterator.rewind-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="methodname" style="color:#CC7832"><strong>Iterator::rewind</strong></span>(): <span class="type" style="color:#EAB766"><span class="type void" style="color:#EAB766">void</span></span></div>  <p class="para rdfs-comment">   返回到迭代器的第一个元素。  </p>  <blockquote class="note" style="border:1px gray solid"><p><strong class="note" style="border:1px gray solid">注意</strong>:    <p class="para">    当开始一个 <a href="https://www.php.net/manual/zh/control-structures.foreach.php" class="link">foreach</a> 循环时，这是<em>第一个</em>被调用的方法。它将<em>不</em>会在 <a href="https://www.php.net/manual/zh/control-structures.foreach.php" class="link">foreach</a> 循环<em>之后</em>被调用。   </p>  </p></blockquote> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-iterator.rewind-parameters">  <h3 class="title">参数</h3>  <span>此函数没有参数。</span> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-iterator.rewind-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   任何返回都将被忽略。  </p> </div></div>
*/
    public function rewind(): void {}

/**
*<div id="iterator.next" class="refentry"> <div class="refnamediv">  <h1 class="refname">Iterator::next</h1>  <p class="verinfo">(PHP 5, PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">Iterator::next</span> &mdash; <span class="dc-title">向前移动到下一个元素</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-iterator.next-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="methodname" style="color:#CC7832"><strong>Iterator::next</strong></span>(): <span class="type" style="color:#EAB766"><span class="type void" style="color:#EAB766">void</span></span></div>  <p class="para rdfs-comment">   移动当前位置到下一个元素。  </p>  <blockquote class="note" style="border:1px gray solid"><p><strong class="note" style="border:1px gray solid">注意</strong>:    <p class="para">   此方法在 <a href="https://www.php.net/manual/zh/control-structures.foreach.php" class="link">foreach</a> 循环<em>之后</em>被调用。   </p>  </p></blockquote> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-iterator.next-parameters">  <h3 class="title">参数</h3>  <span>此函数没有参数。</span> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-iterator.next-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   任何返回都将被忽略。  </p> </div></div>
*/
    public function next(): void {}

/**
*<div id="iterator.current" class="refentry"> <div class="refnamediv">  <h1 class="refname">Iterator::current</h1>  <p class="verinfo">(PHP 5, PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">Iterator::current</span> &mdash; <span class="dc-title">返回当前元素</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-iterator.current-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="methodname" style="color:#CC7832"><strong>Iterator::current</strong></span>(): <span class="type" style="color:#EAB766"><a href="https://www.php.net/manual/zh/language.types.declarations.php#language.types.declarations.mixed" class="type mixed" style="color:#EAB766">mixed</a></span></div>  <p class="para rdfs-comment">   返回当前元素。  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-iterator.current-parameters">  <h3 class="title">参数</h3>  <span>此函数没有参数。</span> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-iterator.current-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   可返回任何类型。  </p> </div></div>
     * @return mixed*/
    public function current() {}

/**
*<div id="iterator.key" class="refentry"> <div class="refnamediv">  <h1 class="refname">Iterator::key</h1>  <p class="verinfo">(PHP 5, PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">Iterator::key</span> &mdash; <span class="dc-title">返回当前元素的键</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-iterator.key-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description"><span class="modifier">public</span> <span class="methodname" style="color:#CC7832"><strong>Iterator::key</strong></span>(): <span class="type" style="color:#EAB766"><a href="https://www.php.net/manual/zh/language.types.declarations.php#language.types.declarations.mixed" class="type mixed" style="color:#EAB766">mixed</a></span></div>  <p class="para rdfs-comment">   返回当前元素的键。  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-iterator.key-parameters">  <h3 class="title">参数</h3>  <span>此函数没有参数。</span> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-iterator.key-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   成功返回<span class="type" style="color:#EAB766"><span class="type 标量" style="color:#EAB766">标量</span></span>，失败则返回 <strong><span>null</span></strong>。  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 errors" id="refsect1-iterator.key-errors">  <h3 class="title">错误／异常</h3>  <p class="para">   失败时分发 <strong><span>E_NOTICE</span></strong> 级错误。  </p> </div></div>
     * @return mixed*/
    public function key() {}

/**
*<div id="iterator.valid" class="refentry"> <div class="refnamediv">  <h1 class="refname">Iterator::valid</h1>  <p class="verinfo">(PHP 5, PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">Iterator::valid</span> &mdash; <span class="dc-title">检查当前位置是否有效</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-iterator.valid-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="methodname" style="color:#CC7832"><strong>Iterator::valid</strong></span>(): <span class="type" style="color:#EAB766">bool</span></div>  <p class="para rdfs-comment">   此方法在 <span class="methodname" style="color:#CC7832">{@link Iterator::rewind()}</span> 和 <span class="methodname" style="color:#CC7832">{@link Iterator::next()}</span> 方法之后被调用以此用来检查当前位置是否有效。  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-iterator.valid-parameters">  <h3 class="title">参数</h3>  <span>此函数没有参数。</span> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-iterator.valid-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   返回将被转换为<span class="type" style="color:#EAB766">bool</span> 。成功时返回 <strong><span>true</span></strong>， 或者在失败时返回 <strong><span>false</span></strong>。  </p> </div></div>
*/
    public function valid(): bool {}

    public function count(): int {}

    public function offsetExists($fd): bool {}

    /**
     * @param mixed $fd
     * @return mixed
     */
